define('mobile/common/shake/main.jsx', function(require, exports, module){ var React = require('fishstrap/react/react-debug.js');
var PureRenderMixin = require('fishstrap/react/react-debug.js').addons.PureRenderMixin;
var $ = require('mobile/common/core/core.js');
var WinList = require('mobile/common/shake/WinList.jsx');

var App = React.createClass({displayName: "App",

  mixins: [PureRenderMixin],

  getInitialState: function() {

    var luckyDrawId = $.location.getQueryArgv('luckyDrawId');

    return {
      last_x : '',
      last_y : '',
      last_z : '',
      test : true,
      errorNum : '',
      luckyDrawId: luckyDrawId,
      luckyDraw: '',
      clientId: '',
      rotateFinishTip: '',
      yaoYiYaoPrizeText:'',
      tentDisplay: false,
      yaoYiYaoDisplay: false,
      yaoYiYaoTextDisplay: false,
      loadingDisplay: false,
      WinListDisplay:false,
      // WinListDisplay:true,
    };

  },

  componentDidMount : function() {


    $.get('/clientlogin/islogin', {}, function(data) {
      if (data.code != 0) {
        location.href = $.url.buildQueryUrl('/clientlogin/wxlogin', {
          callback: location.href
        });
        return;
      }
      this.setState({clientId : data.data});
    }.bind(this));


   $.get('/luckydraw/getClientResult', {
      luckyDrawId: this.state.luckyDrawId
    }, function(data) {
      if (data.code != 0) {

        return;
      }

      this.setState({
        luckyDraw: data.data
      });


      // $('.summary').text(luckyDraw.summary);
      // $('.time').text(luckyDraw.beginTime + ' ~ ' + luckyDraw.endTime);

    }.bind(this));

   this.init();


  },

   init:function() {　　
    if (window.DeviceMotionEvent) {　　　　 // 移动浏览器支持运动传感事件　　　
      window.addEventListener('devicemotion', this.deviceMotionHandler, false);　　
    } 
    else {
      alert('本设备不支持摇一摇（devicemotion）事件');
    }
  },



  deviceMotionHandler:function(eventData) {

  　　 // 获取含重力的加速度
    　　
  
    var x = eventData.accelerationIncludingGravity.x;
    var y = eventData.accelerationIncludingGravity.y;
    var z = eventData.accelerationIncludingGravity.z;
    　　　　　　　　　　　　 // TODO:在此处可以实现摇一摇之后所要进行的数据逻辑操作

    //修复iphone的bug
    if (this.state.test == true) {

      this.setState({
      last_x : x,
      last_y : y,
      last_z : z,
      test : false,
      });
    }

    if ((x != this.state.last_x && x > 18 ) || (y != this.state.last_y && y > 18 )  || (z != this.state.last_z && z > 18 ) ) {
      this.setState({
        last_x : x,
        last_y : y,
        last_z : z,
      });
      window.removeEventListener('devicemotion', this.deviceMotionHandler, false);
      this.yaoYiYao();

    }


  },

  ShowYaoyiyao: function() {
    this.setState({
      tentDisplay: true,
      yaoYiYaoDisplay: true,
      yaoYiYaoTextDisplay: true,
    })
  },
  WinListClock:function(){
    this.setState({
      tentDisplay: false,
      WinListDisplay:false,
    });
    this.init();
  },

  yaoYiYao: function() {
    this.ShowYaoyiyao();
    this.refs.music1.getDOMNode().play();

    //摇一摇图片分裂效果
    var shang = $('.yaoYiYao .image .shang').css('top');
    var xia = $('.yaoYiYao .image .xia').css('top');
    $('.yaoYiYao .image .shang').css('top', '80px');
    $('.yaoYiYao .image .xia').css('top', '348px');
    setTimeout(function() {
      $('.yaoYiYao .image .shang').css('top', shang);
      $('.yaoYiYao .image .xia').css('top', xia);

    }, 500);

    setTimeout(function() {

      this.setState({
          yaoYiYaoTextDisplay: false,
        });

      this.setState({
        loadingDisplay: true,
      });

      $.post('/luckydraw/shakeDraw', {
        luckyDrawId: this.state.luckyDrawId,
      }, function(data) {

        this.refs.music2.getDOMNode().play();

        if (data.code != 0) {
          this.setState({
            errorNum:data.code
          });
        } else {
          var luckyDraw=this.state.luckyDraw;
          for (var i = 0; i != luckyDraw.commodity.length; ++i)
            if (luckyDraw.commodity[i].luckyDrawCommodityId == data.data) {
              this.setState({rotateFinishTip : luckyDraw.commodity[i].title}) ;
              break;
            }
        }

        this.setState({
          yaoYiYaoDisplay: false,
          loadingDisplay: false,
        });

        // if (typeof errorTitle == 'string') {
        //   this.setState({yaoYiYaoPrizeText:errorTitle});
        //   // $('.yaoYiYaoPrizeText').text(errorTitle);
        // } else {
        //   this.setState({yaoYiYaoPrizeText:'恭喜你，你获得的是：' + this.state.rotateFinishTip});
        //   // $('.yaoYiYaoPrizeText').text('恭喜你，你获得的是：' + rotateFinishTip);
        // }

        this.setState({
          WinListDisplay:true, //显示中奖名单
        });

      }.bind(this));
    }.bind(this), 1000);


  },


  render:function(){
    var tentStyle = {
      display:this.state.tentDisplay ? 'block' : 'none',
    };

    var yaoYiYaoStyle = {
      display:this.state.yaoYiYaoDisplay ? 'block' : 'none',
    };

    var yaoYiYaoTextStyle = {
      display:this.state.yaoYiYaoTextDisplay ? 'block' : 'none',
    };

    var loadingStyle = {
      display:this.state.loadingDisplay ? 'block' : 'none',
    };

    var yaoYiYaoPrizeStyle = {
      display:this.state.yaoYiYaoPrizeDisplay ? 'block' : 'none',
    }


    return (
    React.createElement("div", null, 

      React.createElement("div", {className: "head"}, React.createElement("img", {src: 'data:image/png;base64,'})
        ), 
        React.createElement("div", {onClick: this.ShowYaoyiyao, className: "click"}, React.createElement("img", {src: 'data:image/png;base64,'})
        ), 

        React.createElement("div", {className: "banner"}, 
          React.createElement("div", {className: "bannerHead"}, React.createElement("img", {src: 'data:image/png;base64,'})
          ), 
          React.createElement("div", {className: "bannerContent"}, 
            React.createElement("div", {className: "bennerText"}, 
              React.createElement("p", null, "活动规则："), 
              React.createElement("p", {className: "summary"}, this.state.luckyDraw.summary), 
              React.createElement("p", null, "活动时间："), 
              React.createElement("p", {className: "time"}, this.state.luckyDraw.beginTime, " ~ ", this.state.luckyDraw.endTime)
            )
          ), 
          React.createElement("div", {className: "bannerFooter"}, React.createElement("img", {src: 'data:image/png;base64,'})
          )

        ), 

        React.createElement("div", {style: tentStyle, className: "tent"}), 

        React.createElement("div", {style: yaoYiYaoStyle, className: "yaoYiYao"}, 
          React.createElement("div", {className: "image"}, React.createElement("img", {className: "shang", src: 'data:image/png;base64,'}), React.createElement("img", {className: "xia", src: 'data:image/png;base64,'})
          )
        ), 

        React.createElement("div", {style: yaoYiYaoTextStyle, className: "yaoYiYaoText"}, 
          React.createElement("p", null, "大力摇呀！"), 
          React.createElement("p", null, "大奖正朝你的怀抱全力冲刺呢！")
        ), 

        React.createElement("div", {style: loadingStyle, className: "loading"}, React.createElement("img", {src: 'data:image/gif;base64,'})
        ), 

    React.createElement(WinList, {WinListDisplay: this.state.WinListDisplay, WinListClock: this.WinListClock, luckyDrawId: this.state.luckyDrawId, errorNum: this.state.errorNum, rotateFinishTip: this.state.rotateFinishTip}), 


        React.createElement("audio", {ref: "music1", src: "common/shake/1.mp3"}), 
        React.createElement("audio", {ref: "music2", src: "common/shake/2.mp3"}), 
        React.createElement("div", {className: "bg"})

    )
    )
  }
});



var mainCom = React.render(
  React.createElement(App, null),
  document.body
  );
 });